import math as mt

def count_subsequences_generating_k(N, A, queries):
    sz = 1000502
    x = [0] * sz
    gcs = [0] * N
    gcs[N - 1] = A[N - 1]
    for i in range(N - 2, -1, -1):
        gcs[i] = mt.gcd(gcs[i + 1], A[i])
    for i in range(N):
        curr = A[i]
        if curr < sz:
            x[curr] += 1
        for j in range(i + 1, N):
            curr = mt.gcd(curr, A[j])
            if curr == gcs[j]:
                x[curr] += N - j
                break
            elif curr < sz:
                x[curr] += 1
    results = []
    for q1 in queries:
        ans = 0
        for t in range(1, int(mt.sqrt(q1) + 1)):
            if q1 % t == 0:
                if q1 // t == t:
                    ans += x[t]
                else:
                    ans += x[t]
                    ans += x[q1 // t]
        results.append(ans)
    return results

